#отзыв Ивано-Франковск, Даша Брагина.
Мастер очень понравилась. Стрижет на сухие волосы, по методике КГМ. Уход рекомендует в зависимости от типа кожи головы (Даша имеет сертификат трихолога, кроме того что училась на парикмахера). Произвела впечатление очень грамотного и доброжелательного специалиста. Нашлись общие темы для разговоров, но это к делу не относится. Я пришла к ней уже с собственным представлением про КГМ, но после исправления некоторых ошибок в домашнем уходе могу сказать, что перестала недоочищать и раздраженность кожи головы прошла. Работает с марками как мировыми (Джованни), так и лечебными (протеиновая маска, которую мне делала, была от Dr Trichologist, это что-то не продаваемое в магазинах но она рекомендует чем можно заменить. В конце уложила диффузором, подкорректировала форму. Волны мои после стрижки заколосились лучше.
@Elya_master

мини #отзыв
не заметила разницы между кондеями балеа, но они, безусловно, хорошие! норм увлажняют, почти не утяжеляют тонкие волосы, быстро делают водоросли, и пахнут не слишком приторно
